import styled from 'styled-components';

const Container = styled.div`
  display: flex;
  justify-content: center;
  height: 100%;
  align-items: center;
`;

const Section = styled.section`
  background-color: #eee;
  border-top: solid 2px palevioletred;
  padding: 20px 25px;
  width: 500px;
  box-shadow: 0px 2px
`;


function App() {
  return (
    <Container>
      lala
    </Container>
  );
}

export default App;
